import React from 'react';

import './../Tachas.css';

const TipoDeTacha = (props) => {
    const arrayClasses2=["tipo", "fill2"];
    return (
             <li  
            onClick={()=>props.selectTipoDeTacha(props.modelo)}
            
            className={props.tipoDeTacha === props.modelo ? arrayClasses2.join(' '): arrayClasses2[0]}
            >
              <img
              className="image"
              alt="img"
              src="https://d26lpennugtm8s.cloudfront.net/stores/718/076/products/73891531-96a5-4833-8d98-8b51cd9611c7_nube-385bafc285b6c688dd15290787244065-640-0.jpg"
              />
              <p>{props.modelo}</p>
              </li>
    )
}

export default TipoDeTacha
